play: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>'pokemon'</li><li>'predictemall'</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 'pokemon'\n","\\item 'predictemall'\n","\\end{enumerate*}\n"],"text/markdown":["1. 'pokemon'\n","2. 'predictemall'\n","\n","\n"],"text/plain":["[1] \"pokemon\"      \"predictemall\""]},"metadata":{},"output_type":"display_data"}],"source":["# This R environment comes with many helpful analytics packages installed\n","# It is defined by the kaggle/rstats Docker image: https://github.com/kaggle/docker-rstats\n","# For example, here's a helpful package to load\n","\n","library(tidyverse) # metapackage of all tidyverse packages\n","\n","# Input data files are available in the read-only \"../input/\" directory\n","# For example, running this (by clicking run or pressing Shift+Enter) will list all files under the input directory\n","\n","list.files(path = \"../input\")\n","\n","# You can write up to 20GB to the current directory (/kaggle/working/) that gets preserved as output when you create a version using \"Save & Run All\" \n","# You can also write temporary files to /kaggle/temp/, but they won't be saved outside of the current session"]},{"cell_type":"markdown","id":"9ed87a7a","metadata":{"papermill":{"duration":0.006234,"end_time":"2023-01-29T03:25:23.518775","exception":false,"start_time":"2023-01-29T03:25:23.512541","status":"completed"},"tags":[]},"source":["# Affinity Analysis\n","\n","Affinity analysis, also known as *Association rules*, or *Market basket analysis* is one of unsupervised learning methods and is aimed at discovering which group of items is likely goes together. \n","\n","As its another name, market basket analysis, implies, it is originated from the study of customer transactions to figure out dependencies between purchased items. For example, in a transaction database, each record lists all items bought by a customer on a single-purchase. Managers would be interested to know if certain groups of items are consistently purchased together. They could use findings for store layouts to place items frequently purchased together or they could use such information to identify customer segments based on buying patterns.\n","\n","In this project, I would like to determine which Pokémon spawns together by the affinity analysis method. Below is consisting of a two-stage process of rule generation and then assessment strength to choose a useful subset of the rules. "]},{"cell_type":"markdown","id":"cb9f3f9e","metadata":{"papermill":{"duration":0.005797,"end_time":"2023-01-29T03:25:23.530572","exception":false,"start_time":"2023-01-29T03:25:23.524775","status":"completed"},"tags":[]},"source":["# Data Preps"]},{"cell_type":"code","execution_count":2,"id":"b1222e35","metadata":{"execution":{"iopub.execute_input":"2023-01-29T03:25:23.572563Z","iopub.status.busy":"2023-01-29T03:25:23.543881Z","iopub.status.idle":"2023-01-29T03:25:34.951532Z","shell.execute_reply":"2023-01-29T03:25:34.949865Z"},"papermill":{"duration":11.417955,"end_time":"2023-01-29T03:25:34.954379","exception":false,"start_time":"2023-01-29T03:25:23.536424","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message:\n","“\u001b[1m\u001b[22mOne or more parsing issues, call `problems()` on your data frame for details,\n","e.g.:\n","  dat <- vroom(...)\n","  problems(dat)”\n","\u001b[1mRows: \u001b[22m\u001b[34m296021\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m208\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m    (7): _id, appearedTimeOfDay, appearedDayOfWeek, city, continent, weat...\n","\u001b[32mdbl\u001b[39m   (32): pokemonId, latitude, longitude, cellId_90m, cellId_180m, cellId_...\n","\u001b[33mlgl\u001b[39m  (168): closeToWater, urban, suburban, midurban, rural, gymIn100m, gymIn...\n","\u001b[34mdttm\u001b[39m   (1): appearedLocalTime\n","\n","\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n","\u001b[36mℹ\u001b[39m Specify the column types or set `show_col_types = FALSE` to quiet this message.\n"]}],"source":["data <- read_csv(\"../input/predictemall/300k.csv\") # load data\n","affinity.data <- data[,c(1, 57:207)] # leave only necessary variables"]},{"cell_type":"markdown","id":"62221028","metadata":{"papermill":{"duration":0.006119,"end_time":"2023-01-29T03:25:34.967011","exception":false,"start_time":"2023-01-29T03:25:34.960892","status":"completed"},"tags":[]},"source":["In feature description, pokemonId is the identifier of a Pokémon (numeric; ranges between 1 and 151). So, it refers which wild Pokémon a player encountered while playing Pokémon Go. Its range is from 1 to 151, meaning that the data only contains Kanto Pokémon. It seems reasonable considering that the only value in appearedYear is 2016, which is before Niantic updated Pokémon lists.\n","\n","Then features ***cooc 1-cooc 151*** marks co-occurrence with any other pokemon within 100m distance and within the last 24 hours, and has Boolean value. I changed the values from FALSE to TRUE by pokemonId, thereby can create complete transaction matrix. "]},{"cell_type":"code","execution_count":3,"id":"795e943f","metadata":{"execution":{"iopub.execute_input":"2023-01-29T03:25:34.982697Z","iopub.status.busy":"2023-01-29T03:25:34.981196Z","iopub.status.idle":"2023-01-29T03:28:55.720807Z","shell.execute_reply":"2023-01-29T03:28:55.71909Z"},"papermill":{"duration":200.750996,"end_time":"2023-01-29T03:28:55.724344","exception":false,"start_time":"2023-01-29T03:25:34.973348","status":"completed"},"tags":[]},"outputs":[],"source":["# for each row, set corresponding cooc_pokemonId value as TRUE\n","\n","for(i in 1:nrow(affinity.data)){\n","    pokeid <- affinity.data$pokemonId[i]\n","    affinity.data[i, pokeid + 1] <- TRUE # +1 for the first column, pokemonId\n","}"]},{"cell_type":"markdown","id":"899ea507","metadata":{"papermill":{"duration":0.008405,"end_time":"2023-01-29T03:28:55.743356","exception":false,"start_time":"2023-01-29T03:28:55.734951","status":"completed"},"tags":[]},"source":["I loaded another dataset to assign names per each Kanto Pokémon. As mentioned, the 300k dataset has only 1st generation Pokémon back in 2016, and it does not have Mega evolved form. So, I removed such rows from Pokédex."]},{"cell_type":"code","execution_count":4,"id":"7a2c9f0a","metadata":{"execution":{"iopub.execute_input":"2023-01-29T03:28:55.759908Z","iopub.status.busy":"2023-01-29T03:28:55.75845Z","iopub.status.idle":"2023-01-29T03:28:55.923941Z","shell.execute_reply":"2023-01-29T03:28:55.922222Z"},"papermill":{"duration":0.175896,"end_time":"2023-01-29T03:28:55.926387","exception":false,"start_time":"2023-01-29T03:28:55.750491","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1mRows: \u001b[22m\u001b[34m800\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m13\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m (3): Name, Type 1, Type 2\n","\u001b[32mdbl\u001b[39m (9): #, Total, HP, Attack, Defense, Sp. Atk, Sp. Def, Speed, Generation\n","\u001b[33mlgl\u001b[39m (1): Legendary\n","\n","\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n","\u001b[36mℹ\u001b[39m Specify the column types or set `show_col_types = FALSE` to quiet this message.\n"]}],"source":["pokedex <- read_csv(\"../input/pokemon/Pokemon.csv\") %>%\n","    select(\"#\", \"Name\") %>%\n","    filter(!grepl(\"Mega\", Name) & `#` <= 151) # remove Mega evolution\n","\n","# Turn variable names cooc_ to Pokemon