.transac, topN=20, type='relative')"]},{"cell_type":"markdown","id":"3bde2b4f","metadata":{"papermill":{"duration":0.008535,"end_time":"2023-01-29T03:29:02.005317","exception":false,"start_time":"2023-01-29T03:29:01.996782","status":"completed"},"tags":[]},"source":["In terms of single item, we see above Pidgey is the most common Pokémon players encountered, followed by Rattata and Nidoran (male). We can also observe that excluding the top 5 most common Pokémons, the number of each Pokémon appeared is similar."]},{"cell_type":"markdown","id":"bb60d865","metadata":{"papermill":{"duration":0.008354,"end_time":"2023-01-29T03:29:02.022975","exception":false,"start_time":"2023-01-29T03:29:02.014621","status":"completed"},"tags":[]},"source":["# Generating Candidate Rules: Apriori algorithm"]},{"cell_type":"markdown","id":"8f89cff6","metadata":{"papermill":{"duration":0.008725,"end_time":"2023-01-29T03:29:02.040203","exception":false,"start_time":"2023-01-29T03:29:02.031478","status":"completed"},"tags":[]},"source":["In a nutshell, the affinity analysis summarizes data as “what goes with what.” So, the basic idea behind is to examine all possible rules between items in an if-then format and select only those are most likely to be indicators of true dependence. We use the term *antecedent* to describe the \"if\" part, and *consequent* to describe the \"then\" part. In affinity analysis, the antecedent and consequent are sets of items (called item sets) that are disjoint.\n","\n","The first stage of the analysis is to generate all possible rules. Back to the Pokémon Go, one of the possible rules from transaction ID 1 {Bulbasaur, Pidgey, Rattata, Nidoran♂} is \"if Bulbasaur, then Pidgey\", meaning that if a Bulbasaur spawned, a Pidgey is too within 100m distance and 24 hours. Another possible rule with the same transaction is \"if Bulbasaur and Pidgey, then Rattata.\"\n","\n","However, generating all possible combination with 300k transactions requires huge computational resources and is impractical. A better way is to consider only combinations that occur with higher frequency in the data. Such combinations are called **frequent item sets**.\n","\n","Determining elements of the frequent item set is related to the concept of **support**. Support of a rule is simply proportion of transactions that include both the antecedent and consequent item sets on the entire transactions. What constitutes a frequent item set is therefore defined as an item set that has a support exceeding a selected minimum."]},{"cell_type":"markdown","id":"7845dece","metadata":{"papermill":{"duration":0.008318,"end_time":"2023-01-29T03:29:02.056915","exception":false,"start_time":"2023-01-29T03:29:02.048597","status":"completed"},"tags":[]},"source":["### Apriori algorithm\n","\n","Apriori is the first and most widely used algorithm to generate frequent item sets. The key idea behind the algorithm is to begin with generating frequent item sets with just one item (one-item sets) and to recursively generate frequent item sets with two items, then with three items, and so on until we have generated frequent item sets of all 151 Pokémon.\n","\n","It is easy to generate frequent one-item sets, as it is just simple count of each item. These transaction counts are the supports for the one-item sets. We drop one-item sets that have support below the desired minimum. Then generating frequent two-item sets, based on the selected frequent one-item sets. If a certain one-item set has support below threshold, any larger size item set, including the item will not exceed the desired minimum support. "]},{"cell_type":"markdown","id":"2d9afdc3","metadata":{"papermill":{"duration":0.009067,"end_time":"2023-01-29T03:29:02.075191","exception":false,"start_time":"2023-01-29T03:29:02.066124","status":"completed"},"tags":[]},"source":["# Selecting Strong Rules"]},{"cell_type":"markdown","id":"5b634011","metadata":{"papermill":{"duration":0.008929,"end_time":"2023-01-29T03:29:02.092645","exception":false,"start_time":"2023-01-29T03:29:02.083716","status":"completed"},"tags":[]},"source":["### Confidence\n","\n","In addition to support, **confidence** of the rule compares the cooccurrence of the antecedent and consequent item sets in the data to the occurrence of the antecedent item sets. \n","\n","$$\n","\\text{confidence} = \\frac{P(\\text{antecedent} \\cap \\text{consequent})}{P(\\text{antecedent})} = P(\\text{consequent}|\\text{antecendent})\n","$$"]},{"cell_type":"markdown","id":"0ff78029","metadata":{"papermill":{"duration":0.008356,"end_time":"2023-01-29T03:29:02.109684","exception":false,"start_time":"2023-01-29T03:29:02.101328","status":"completed"},"tags":[]},"source":["### Lift Ratio\n","\n","A good benchmark of confidence is the occurrence of the consequent item set in a transaction, under assuming independence with the occurrence of antecedent. Under independence, support of a rule would be...\n","\n","$$\n","P(\\text{antecedent} \\cap \\text{consequent}) = P(\\text{antecedent})\\times P(\\text{consequent})\n","$$\n","\n","And the benchmark confidence would be...\n","\n","$$\n","\\frac{P(\\text{antecedent})\\times P(\\text{consequent})}{P(\\text{antecedent})} = P(\\text{consequent})\n","$$\n","\n","We compare the confidence to the benchmark value: it is called the **lift ratio** of a rule. \n","\n","$$\n","\\text{Lift Ratio} = \\frac{\\text{confidence}}{\\text{benchmark confidence}}\n","$$\n","\n","A lift ratio greater than 1.0 suggests that there is some usefulness to the rule. But please note that it cannot be used alone and should be considered together with support. This is because if a rule has a huge lift with very low support, it is simply due to a rare case and is not desirable."]},{"cell_type":"code","execution_count":9,"id":"3e57418d","metadata":{"execution":{"iopub.execute_input":"2023-01-29T03:29:02.129738Z","iopub.status.busy":"2023-01-29T03:29:02.128243Z","iopub.status.idle":"2023-01-29T03:29:02.540837Z","shell.execute_reply":"2023-01-29T03:29:02.538959Z"},"papermill":{"duration":0.42531,"end_time":"2023-01-29T03:29:02.54336","exception":false,"start_time":"2023-01-29T03:29:02.11805","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Apriori\n","\n","Parameter specification:\n"," confidence minval smax arem  aval originalSupport maxtime support minlen\n","        0.5    0.1    1 none FALSE            TRUE       5    0.01      1\n"," maxlen target  ext\n","     10  rules TRUE\n","\n","Algorithmic control:\n"," filter tree heap memopt load sort verbose\n","    0.1 TRUE TRUE  FALSE TRUE    2    TRUE\n","\n","Absolute minimum support count: 2960 \n","\n","set item appearances ...[0 item(s)] done [0.00s].\n","set transactions ...[144 item(s), 296021 transaction(s)] done [0.08s].\n","sorting and recoding items ... [41 item(s)] done [0.01s].\n","creating transaction tree ... done [0.17s].\n","checking subsets of size 1 2 3 4 done [0.01s].\n","writing ... [43 rule(s)] done [0.00s].\n","creating S4 object  ... done [0.06s].\n"]}],"source":["Rules <- apriori(cooc.transac, parameter = list(support = 0.01, confidence = 0.5))\n","Rules_supp <- sort(Rules, by = \"support\", decreasing = TRUE) # sort by supports\n","Rules_conf <- sort(Rules, by = \"confidence\", decreasing = TRUE) # sort by confidence\n","Rules_lift <- sort(Rules, by = \"lift\", decreasing = TRUE) # sort by lift"]},{"cell_type":"markdown","id":"f2016143","metadata":{"papermill":{"duration":0.008585,"end_time":"2023-01-29T03:29:02.560495","exception":false,"start_time":"2023-01-29T03:29:02.55191","status":"completed"},"tags":[]},"source":["With minimum support 0.01 and confidence 0.5, I generated 43 rules. We see below the rule with most support is \"if Venonat, then Nidoran♂\", followed by \"if Rattata and Nidoran♂, then Pidgey.\""]},{"cell_type":"code","execution_count":10,"id":"7b2b0376","metadata":{"execution":{"iopub.execute_input":"2023-01-29T03:29:02.582061Z","iopub.status.busy":"202